import { footer } from "motion/react-client"

const footerDivs = [
  {txt: 'Created November 26, 2024'},
  {txt: '(703) 999-1175', icon: 'fa fa-phone'},
  {txt: 'braedenmeikle@gmail.com', link: 'mailto:braedenmeikle@gmail.com', icon: 'fa fa-envelope'},
  {txt: 'linkedin.com/in/bmeikle3/', link: 'https://www.linkedin.com/in/bmeikle3/', icon: 'fa fa-linkedin-square'},
  {txt: 'bmeikle56', link: 'https://github.com/bmeikle56', icon: 'fa fa-github'},
]

const iconStyle = {
  fontSize: '12px',
  color: 'gray'
}

function Footer() {
  return (
    <div className='footer'>
      {footerDivs.map(footerDiv =>
        footerDiv.link
          ? <a ref='noreferrer' target='_blank' href={footerDiv.link}>
              <p className='footer-txt'>{footerDiv.txt}</p>
            </a>
          : <p className='footer-txt'>{footerDiv.txt}</p>
      )}
    </div>
  )
}

export { Footer }
